What you’ll need:
1/2 cup milk (I used coconut)
1 tsp lemon juice 
1/4 cup gluten free flour 
1/4 cup peanut butter, melted (or PB2)
2 tbsp cocoa powder
1 tbsp pure maple syrup 
1 tsp baking powder
Pinch of salt
2 tbsp water

Start off by combining the lemon juice and milk of your choice in a small bowl, and let sit for a few minutes. While you wait, combine flour, peanut butter, cocoa powder, maple syrup, baking powder & salt in a large bowl. Stir well. Add milk & lemon juice mixture to dry ingredients, along with water, and whisk together. Then, you’re all ready to start cooking up some pancakes! 

I topped these with some added peanut butter drizzle & pure maple syrup. Best way to start the day 🤗
