Riquisimo sano y lo mas importante 100% verduras. Super rendidor
Lo mejor es que al dejarlo en el congelador o frizzer no se llega a congelar por lo que es super conveniente para ir sacando cucharadas de forma super facil

INGREDIENTES 
Bandeja de 500g de verduras (las que se venden para sopa)
Se puede poner verduras de forma separada.. solo tener en cuenta que deben contener verduras que no sean muy aguosas y que tengan cuerpo
A parte de la bandeja agregamos 1 cebolla grande
Muchos condimentos
1/4 taza de sal marina

PROCEDIMIENTO 
colocar todo a fuego bajo y esperar a que reduzca todo
Ir revolviendo de poco en poco hasta que todo se encuentre bien bien cocido
Procesar hasta qie se forme una pasta
Colorcar en recipientes aptos para frizzer y ya esta

1 cucharada equivale a 1 cubito de caldo

Es ideal para carnes sopas salsas o cualquier preparacion que requiera condimento

