Some people do not know the difference between physical activity and exercise (I was one of them). It is such a simple thing but I wanted to share it.

Remember this:
✅Physical activity = exercise; BUT
🚫Exercise can not be physical activity.

EXAMPLE: Walking around the block for an older person is exercising for them. While walking around the block for a fit student is physical activity for them but not exercise. 

To put into perspective:
• Walking around campus for me would be considered physical activity. While, for an older individual, it can be an exercise for them.
• Resistance training or repeatedly challenging myself at the gym to achieve my goals is exercising for me - not physical activity. 🏋🏼‍♀️

𝗣𝗵𝘆𝘀𝗶𝗰𝗮𝗹 𝗔𝗰𝘁𝗶𝘃𝗶𝘁𝘆 is repeatedly and purposeful bodily movement produced by voluntary skeletal muscle actions that increase the metabolism. 
⠀
There is: 
